import React, { Component } from "react";

class categoryButton extends Component {
  state = {
    value: this.props.value,
  };

  styles = {
    fontSize: 50,
    fontWeight: 10,
  };

  render() {
    return (
      <React.Fragment>
        <a className="btn btn-primary" href="#">
          {this.getValue()} category
        </a>
      </React.Fragment>
    );
  }

  getValue() {
    return this.props.value;
  }
}

export default categoryButton;
